在 Autofac 中，WithTag 方法和 InstancePerMatchingLifetimeScope 方法都允许您在不同的作用域中创建相同服务的不同实例，但它们的使用方式略有不同。
WithTag 方法用于在注册服务时为服务实例打上特定的标签。然后，您可以使用 BeginLifetimeScope 方法创建一个带有特定标签的新作用域，并使用 Resolve 方法在该作用域内解析服务实例。
```
var builder = new ContainerBuilder();
builder.RegisterType<MyService>().As<IMyService>().InstancePerLifetimeScope().WithTag("Tag1");
var container = builder.Build();
using (var scope = container.BeginLifetimeScope("Tag1"))
{
    var myService = scope.Resolve<IMyService>();
    //...
}
```
InstancePerMatchingLifetimeScope 方法用于基于匹配的标签或键在不同的作用域中创建相同服务的不同实例。您可以在注册服务时指定此键或标签，然后使用 Resolve 方法在特定作用域内解析服务实例。
```
var builder = new ContainerBuilder();
builder.RegisterType<MyService>().As<IMyService>().InstancePerMatchingLifetimeScope("Tag1");
var container = builder.Build();
using (var scope = container.BeginLifetimeScope())
{
    scope.Tag = "Tag1";
    var myService = scope.Resolve<IMyService>();
    //...
}
```
总之，WithTag 方法用于在注册服务时为服务实例打上特定的标签，然后使用 BeginLifetimeScope 方法创建一个带有特定标签的新作用域，并使用 Resolve 方法在该作用域内解析服务实例。InstancePerMatchingLifetimeScope 用于基于匹配的标签或键在不同的作用域中创建相同服务的不同实例，您可以在注册服务时指定此键或标签，然后使用 Resolve 方法在特定作用域内解析服务实例。

