数值分析实验报告：Matlab中的根查找方法
目的：本实验的目的是在Matlab中实现并比较二分法和牛顿-拉夫逊法来查找方程的根，并调查牛顿-拉夫逊法的收敛速度。
问题描述：
给定方程x = x^3-3*x+1，使用二分法找到方程的根，迭代次数为5次，假设初始区间为[0,1]。
给定方程f(x)=x^3-2*x^2+x-3，使用牛顿-拉夫逊法找到方程的根，初始猜测值为4，绝对误差容限为0.02。然后检查牛顿-拉夫逊法的收敛速度。
问题讨论：
二分法是一种简单而稳健的查找方程根的方法。它通过迭代将初始区间分成两半，并选择包含根的子区间。该方法保证收敛到根，但收敛速度较慢。
牛顿-拉夫逊法是一种更有效的查找方程根的方法，因为它使用函数的导数来更新根的估计值。但是，该方法需要知道函数的导数，并且如果初始猜测值与实际根不足够接近，则可能不会收敛或收敛到不同的根。
在本实验中，我们将在Matlab中实现二分法和牛顿-拉夫逊法，并比较它们在查找给定方程根方面的性能。此外，我们将通过检查误差比是否接近2来调查牛顿-拉夫逊法的收敛速度，这表明二次收敛。
代码：
```
% 二分法
% 定义函数
f = @(x) x^3 - 3*x + 1;
% 定义初始区间
a = 0;
b = 1;
% 定义迭代次数
n = 5;
% 初始化变量
fa = f(a);
fb = f(b);
% 检查初始区间是否有相反的符号
if fa*fb > 0
    error('Initial interval does not bracket a root.')
end
% 通过二分法迭代
for i = 1:n
    c = (a + b) / 2;
    fc = f(c);
    if fc == 0
        break
    elseif fa*fc < 0
        b = c;
        fb = fc;
    else
        a = c;
        fa = fc;
    end
end
% 打印根
fprintf('Root: %f\n', c)
% 牛顿-拉夫逊法
% 定义函数及其导数
f = @(x) x^3 - 2*x^2 + x - 3;
df = @(x) 3*x^2 - 4*x + 1;
% 定义初始猜测值
x0 = 4;
% 定义绝对误差容限
tol = 0.02;
% 初始化变量
x = x0;
dx = 1;
% 通过牛顿-拉夫逊法迭代
while abs(dx) > tol
    dx = f(x) / df(x);
    x = x - dx;
end
% 打印根
fprintf('Root: %f\n', x)
