    int num_training_images = MNIST_TRAINING_SET_SIZE;
    int num_mini_batches = num_training_images / mini_batch_size;
    for (int epoch = 0; epoch < num_epochs; epoch++) {
        shuffle_training_data(training_data, num_training_images);
        for (int mini_batch = 0; mini_batch < num_mini_batches; mini_batch++) {
            int start = mini_batch * mini_batch_size;
            int end = start + mini_batch_size;
            double delta_weights_hidden[mlp->num_hidden][mlp->num_inputs];
            double delta_bias_hidden[mlp->num_hidden];
            double delta_weights_output[mlp->num_outputs][mlp->num_hidden];
            double delta_bias_output[mlp->num_outputs];
            memset(delta_weights_hidden, 0, sizeof(delta_weights_hidden));
            memset(delta_bias_hidden, 0, sizeof(delta_bias_hidden));
            memset(delta_weights_output, 0, sizeof(delta_weights_output));
            memset(delta_bias_output, 0, sizeof(delta_bias_output));
            for (int i = start; i < end; i++) {
                double *inputs = training_data[i].pixels_normalized;
                double *outputs = one_hot_encode(training_data[i].label);
                feedforward(mlp, inputs);
                backpropagate_output(&(mlp->output_layer[0]), mlp->hidden_layer[num_hidden-1].output, outputs[0], learning_rate, delta_weights_output[0], delta_bias_output);
                for (int j = mlp->num_hidden - 1; j > 0; j--) {
