            }
            update_weights_biases(&(mlp->output_layer[0]), delta_weights_output[0], delta_bias_output);
            for (int j = mlp->num_hidden - 1; j > 0; j--) {
                update_weights_biases(&(mlp->hidden_layer[j]), delta_weights_hidden[j], delta_bias_hidden[j]);
            }
            update_weights_biases(&(mlp->hidden_layer[0]), delta_weights_hidden[0], delta_bias_hidden[0]);
